  const postJobs = state.postJob.data;
  console.log("postjob", postJobs);

  return (
    <div className="App">
      <Header />
      <h1 className="heading">VACANCIES HERE</h1>
      postJobs.data.map((data) => ({
        <Cards>
        title={data.title}
description={"know the basics of PHP"}
gpa={"3.34"}
salary={"35,000"}
postedBy={"Osama Bashir"}
button={"Apply Now"}
footer={"Last date to apply is 29 Nov,2021"}

        </Cards>
 } ))

    </div>
  );
};

export default Vacancies;
